import React from 'react';
import ReactDOM from 'react-dom';
import { useState } from 'react';
import $ from 'jquery';
import './style.css';

function Frame(type) {
  const [lists, setLists] = useState('');
  setLists([
    { title: '1', text: '1'},
    { title: '2', text: '1'},
    { title: '3', text: '1'},
    { title: '4', text: '1'},
    { title: '5', text: '1'},
    { title: '6', text: '1'},
    { title: '7', text: '1'},
  ]);
  function renderLists() {
    return this.state.lists.map(x => {
      const title = x.title;
      const text = x.text;
      return List({title, text});
    })
  }
  const div = <div id={type}>
    {renderLists()}
  </div>;
  console.log(div);
  for (let i = 0; i < 7; i ++) {
    const list = List(type);
    div.addElement(list);
  }
  return div[0];
}

function List(type) {
  return <ul></ul>;
}

function Task(type) {
  return <li>task</li>
}

function init() {
  ReactDOM.render(Frame('gnome'), $('#root')[0]);
}

